import React from 'react'

const AcademicSection = () => {
  return (
    <>
    <div>
        <h1 className='text-black text-center text-4xl font-bold mt-6'>Academic Information</h1>
        <h1 className='text-black  text-lg font-mono ml-14'>Software Engineer</h1>
        <h1 className='text-black  text-lg font-mono ml-14'>University of Antioquia</h1>
        <h1 className='text-black  text-lg font-mono ml-14'>2017 - Currently</h1>
    </div>
    </>
  )
}

export  {AcademicSection}
